import styled from 'styled-components';

export const Container = styled.div`
  height: 100vh;
  display: flex;
`;

export const Content = styled.div``;

export const Nav = styled.nav`
  background: #373737;
  color: #c0b283;
  height: 30px;
  flex: 1;

  ul {
    /* background: red; */
    strong {
      color: #fff;
      font-size: 18px;
      font-weight: 300;
    }
  }

  li {
    /* background: blue; */
    display: inline;

    a {
      text-decoration: none;
      list-style: none;
    }
  }
`;
